import React, { useEffect, useState } from "react";
import axios from "../utils/axiosInstance";

const HistoryList = () => {
  const [history, setHistory] = useState([]);

  useEffect(() => {
    const fetchHistory = async () => {
      try {
        const res = await axios.get("/gdpr/history");
        setHistory(res.data);
      } catch (err) {
        console.error("Kunne ikke hente historik", err);
      }
    };
    fetchHistory();
  }, []);

  if (history.length === 0) return <p style={{ marginTop: "2rem" }}>Ingen tidligere analyser endnu.</p>;

  return (
    <div style={{ marginTop: "3rem" }}>
      <h3 style={{ marginBottom: "1rem" }}>Tidligere analyser</h3>
      <div style={{
        display: "grid",
        gridTemplateColumns: "repeat(auto-fit, minmax(300px, 1fr))",
        gap: "1rem"
      }}>
        {history.map((entry) => (
          <div
            key={entry.id}
            style={{
              background: "#fff",
              borderRadius: "10px",
              padding: "1.2rem",
              boxShadow: "0 2px 6px rgba(0,0,0,0.1)",
              borderLeft: "6px solid #8a7e72"
            }}
          >
            <p style={{ fontSize: "0.9rem", marginBottom: "0.3rem", color: "#888" }}>
              {new Date(entry.created_at).toLocaleString()}
            </p>
            <h4 style={{ marginBottom: "0.5rem" }}>{entry.url}</h4>
            <p><strong>Score:</strong> {entry.score}%</p>
            <p><strong>Mangler:</strong> {entry.missing?.join(", ") || "Ingen"}</p>
            <p><strong>Forslag:</strong></p>
            <ul>
              {entry.suggestions?.map((s, i) => (
                <li key={i}>{s}</li>
              ))}
            </ul>
          </div>
        ))}
      </div>
    </div>
  );
};

export default HistoryList;
